import React from 'react';
import './Home.css';

const Home: React.FC = () => {
  return (
    <div className="hero">
      <div className="overlay">
        <div className="content">
          <h1>UX/UI Developer</h1>
          <p>I develop websites using modern front-end frameworks.</p>
          <div className="dots">
            <span className="dot active" />
            <span className="dot" />
            <span className="dot" />
            <span className="dot" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
